from django.test import TestCase
from scripts import load_database
from CensusChoropleth.models import Geography, Characteristic, GeoLevel, Datum
import random
import io
import os
import sys
import pandas as pd

_SEED = 1234567


class LoadDatabaseTests(TestCase):
    COL_NAMES = ['CENSUS_YEAR', 'DGUID', 'ALT_GEO_CODE', 'GEO_LEVEL', 'GEO_NAME', 'TNR_SF', 'TNR_LF', 'DATA_QUALITY_FLAG', 'CHARACTERISTIC_ID', 'CHARACTERISTIC_NAME', 'CHARACTERISTIC_NOTE', 'C1_COUNT_TOTAL', 'SYMBOL', 'C2_COUNT_MEN+', 'SYMBOL.1', 'C3_COUNT_WOMEN+', 'SYMBOL.2', 'C10_RATE_TOTAL', 'SYMBOL.3', 'C11_RATE_MEN+', 'SYMBOL.4', 'C12_RATE_WOMEN+',
                 'SYMBOL.5']

    def test_run(self):
        """Tests the run function. Note: Only tests that a database is not built when it already exists. The database build function is covered under test_build_database
        """
        captured_output = io.StringIO()
        LoadDatabaseTests.mock_database()
        sys.stdout = captured_output
        load_database.run()
        sys.stdout = sys.__stdout__
        self.assertEqual(captured_output.getvalue(
        ), "Database already populated, no need to build database\n")

    def test_correct_df(self):
        """Checks dataframe has been made correctly by checking column names
        """
        df = load_database.load_parquet()
        for i in range(len(df.columns.values)):
            self.assertEqual(df.columns.values[i], self.COL_NAMES[i])

    def test_download_csv(self):
        # Test with a small CSV downloaded from statistics canada
        load_database.download_csv("https://www12.statcan.gc.ca/census-recensement/2021/dp-pd/prof/details/download-telecharger/comp/GetFile.cfm?Lang=E&FILETYPE=CSV&GEONO=001",
                                   "98-401-X2021001_Geo_starting_row.CSV", "test.csv", False)
        df = pd.read_csv("test.csv")
        print(df["Geo Name"].values)

        self.assertListEqual(list(df["Geo Name"].values), ["Canada", "Newfoundland and Labrador", "Prince Edward Island", "Nova Scotia", "New Brunswick",
                                                           "Quebec", "Ontario", "Manitoba", "Saskatchewan", "Alberta", "British Columbia", "Yukon", "Northwest Territories", "Nunavut"])
        os.remove("test.csv")

        # Verify correct deletion of first line
        load_database.download_csv("https://www12.statcan.gc.ca/census-recensement/2021/dp-pd/prof/details/download-telecharger/comp/GetFile.cfm?Lang=E&FILETYPE=CSV&GEONO=001",
                                   "98-401-X2021001_Geo_starting_row.CSV", "test.csv", True)
        df = pd.read_csv("test.csv")
        self.assertListEqual(list(df.columns), [
                             "2021A000011124",	"Canada",	"2"])
        os.remove("test.csv")

    def test_save_load_csv(self):
        """Tests both the save_csv_parquet function and the load_parquet function
        """
        load_database.download_csv("https://www12.statcan.gc.ca/census-recensement/2021/dp-pd/prof/details/download-telecharger/comp/GetFile.cfm?Lang=E&FILETYPE=CSV&GEONO=001",
                                   "98-401-X2021001_Geo_starting_row.CSV", "test.csv", False)
        unmodified = pd.read_csv("test.csv")

        load_database.save_csv_parquet("test")
        modified = load_database.load_parquet("test")

        pd.testing.assert_frame_equal(unmodified.head(0), modified.head(
            0), check_dtype=False, check_column_type=False)
        os.remove("test.parquet")

    def test_gen_geo_levels(self):
        load_database.clear_databases()
        geo_levels = load_database.gen_geo_levels(["province", "territory"])

        self.assertEqual(len(GeoLevel.objects.all()), 2)
        self.assertEqual(
            str(GeoLevel.objects.get(name="province")), "province")
        self.assertEqual(
            str(GeoLevel.objects.get(name="territory")), "territory")
        self.assertEqual(geo_levels["province"].name, "province")
        self.assertEqual(geo_levels["territory"].name, "territory")
        load_database.clear_databases()

