    def test_build_databases(self):
        df = pd.DataFrame.from_dict({"CHARACTERISTIC_NAME": ["Population", "Population", "Land Area"],
                                     "DGUID": ['1', '2', '1'],
                                     "GEO_LEVEL": ["Province", "Country", "Province"],
                                     "GEO_NAME": ["Alberta", "Canada", "Alberta"],
                                     "C1_COUNT_TOTAL": ["23", "37", "42"]})
        load_database.build_databases(df, add_geography=False)

        self.assertEqual(len(GeoLevel.objects.all()), 5)
        self.assertEqual(len(Characteristic.objects.all()), 2)
        self.assertEqual(len(Geography.objects.all()), 2)
        self.assertEqual(len(Datum.objects.all()), 3)

        char_pop = Characteristic.objects.get(char_name="Population")
        char_land_area = Characteristic.objects.get(char_name="Land Area")

        province = GeoLevel.objects.get(name="Province")
        country = GeoLevel.objects.get(name="Country")

        alberta = Geography.objects.get(geo_name="Alberta")
        canada = Geography.objects.get(geo_name="Canada")

        self.assertEqual(alberta.geo_level, province)
        self.assertEqual(canada.geo_level, country)

        self.assertEqual(Geography.objects.get(
            dguid="1").geo_name, alberta.geo_name)
        self.assertEqual(Geography.objects.get(
            dguid="2").geo_name, canada.geo_name)

        self.assertEqual(Datum.objects.get(
            geo=alberta, characteristic=char_pop).value, 23)
        self.assertEqual(Datum.objects.get(
            geo=canada, characteristic=char_pop).value, 37)
        self.assertEqual(Datum.objects.get(
            geo=alberta, characteristic=char_land_area).value, 42)

    @staticmethod
    def mock_database():
        random.seed(_SEED)

        # Clear any present database
        GeoLevel.objects.all().delete()
        Geography.objects.all().delete()
        Characteristic.objects.all().delete()
        Datum.objects.all().delete()

        geo_levels = ['Country', 'Province', 'Census division',
                      'Census subdivision', 'Territory']
        for geo_level in geo_levels:
            GeoLevel.objects.create(name=geo_level)

        Geography.objects.create(dguid="2021A000210", geo_name="Newfoundland and Labrador", geo_level=GeoLevel.objects.get(
            name="Province"))
        Geography.objects.create(dguid="2021A00031001", geo_name="Division No.  1, Census division (CDR)", geo_level=GeoLevel.objects.get(
            name="Census division"))

        Characteristic.objects.create(char_name="Population")
        Characteristic.objects.create(char_name="Size")
        Characteristic.objects.create(char_name="Quantity of elephants")

        for geo in Geography.objects.all():
            for characteristic in Characteristic.objects.all():
                Datum.objects.create(
                    geo=geo, characteristic=characteristic, value=random.random())
